import React from 'react';
import "./homepage.css"


const Homepage = () => {

    return (
        <>
            <div id="hero-image">
                <div id="hero-text">
                    <h1>I am John Doe</h1>
                    <p>And I'm a Photographer</p>
                    <button>Hire me</button>
                </div>
            </div>
        </>
    )

}

export default Homepage;
